import React from "react";
import Input from "./Input";

function Form(){
    return (
      <form className="form">
        <Input
            type="text"
            placeholder="Username"
        />
        <Input 
            type="password"
            placeholder="Passsword"
        /> 
        <Input
            type="password"
            placeholder="Confirm Password"
        />
  
        <button type="submit">Register</button>
    </form>
    )
}

export default Form;
